                B0 = isoGrid.B0map[:,:,k]
                
                #phi_precess = -self.B0*self.gamma*self.dt
                phi_precess = 0
                
                
                E1 = np.exp(-self.dt/T1)
                E2 = np.exp(-self.dt/T2)
            
                #print('E1', E1)
                #print('E2',E2)
                #print(E1.shape)
                #print(E2.shape)
                
                A = self.A_mtrx(isoGrid, E1, E2, rotZ(phi_precess))
                
                #print('A_mtrx=', A)
                #A = np.array([[E2,0,0],[0,E2,0],[0,0,E1]]) @ rotZ(phi_precess)
                #A = A.astype(np.float)
                #print('A',A.shape)
                #print(type(A))
                #print(A)
                
                #B_arr = np.array([0,0,1-E1])
                #B = np.full((isoGrid.getSize(0),isoGrid.getSize(1),3), B_arr)
                #print('B', B.shape)
                B = self.B_mtrx(isoGrid, E1)
                
                # Calculate location of the current voxel
                #r = np.multiply( [i-isoGrid.getCenter(0), j-isoGrid.getCenter(1), k-isoGrid.getCenter(2)], self.resolution )
                r = self.calc_r(isoGrid)[:,:,k,:]
                for t in range(1, (int)(np.round(self.TR/self.dt))+1):

                    if  (np.linalg.norm(self.Beff_t[:,t-1]) != 0):
                        # Only simulate if there is a B1 field              
                        phi   = np.rad2deg(np.arctan(self.Beff_t[1, t-1] / self.Beff_t[0, t-1])) #x and y
                        theta = np.rad2deg(np.arctan(self.Beff_t[2, t-1] / self.Beff_t[0, t-1])) #x and z
                
                        #print(M_t[t-1, 2, 2, k, :])
                        #print(M_t[t-1, 2, 2, k, :].shape)
                        #print(M_t[t-1, :, :, k, :].shape)
                        #print(M_t[t-1, :, :, k, :])
                        
                        #print(np.transpose(M_t[t-1, :, :, k, :]).shape)
                        #print(np.transpose(M_t[t-1, :, :, k, :]))
                        #rotZ_phi       = self.rot_4Dmax(isoGrid, rotZ(phi))
                        #print(rotZ_phi.shape)
                        #rotY_theta     = self.rot_4Dmax(isoGrid, rotY(theta))
                        #rotZ_Beff      = self.rot_4Dmax(isoGrid, rotZ(self.Beff_t[2,t-1]*self.dt))
                        #rotX_Beff      = self.rot_4Dmax(isoGrid, rotX(self.Beff_t[0,t-1]*self.dt))
                        #rotY_theta_min = self.rot_4Dmax(isoGrid, rotY(-theta))
                        #rotZ_phi_min   = self.rot_4Dmax(isoGrid, rotZ(-phi))
                        #M_t[t, :, :, k, :] = rotZ_phi @ rotY_theta @ rotZ_Beff @ rotX_Beff @ rotY_theta_min @ rotZ_phi_min @ M_t[t-1, :, :, k, :]
                        rotZ_phi_min       = np.einsum('xz,mnz->mnx', rotZ(-phi),                       M_t[t-1, :, :, k, :])
                        rotY_theta_min     = np.einsum('xz,mnz->mnx', rotY(-theta),                     rotZ_phi_min)
                        rotX_Beff          = np.einsum('xz,mnz->mnx', rotX(self.Beff_t[0,t-1]*self.dt), rotY_theta_min)
                        
                        B0_ein = B0*self.dt
                        B0_einsum = self.rotGF_mtrx(isoGrid, B0_ein)
                        rotZ_Beff          = np.einsum('qwex,qwx->qwe', B0_einsum, rotX_Beff)
                        #rotZ_Beff          = np.einsum('xz,mnz->mnx', rotZ(B0*self.dt), rotX_Beff)
                        rotY_theta         = np.einsum('xz,mnz->mnx', rotY(theta),                      rotZ_Beff)
                        M_t[t, :, :, k, :] = np.einsum('xz,mnz->mnx', rotZ(phi),                        rotY_theta)
                        #print(M_t[t, 1, 1, k, :])
                        
                    elif (np.linalg.norm(self.Beff_t[:,t-1]) == 0):
                        M_t[t,:,:,k,:] = np.einsum('qwex,qwx->qwe', A, M_t[t-1,:,:,k,:]) + B
