#@njit
def phantomcalc(grid, seq):
    gridPhantom = copy.deepcopy(grid)
    phantomcalc = np.zeros((3))
    for i in range(2):
        seq.fOrder = i
        phantomcalc[i] = seq.simSeq(gridPhantom)
    gridNoFlow = phantomcalc[0]
    gridFlow1 = phantomcalc[1]
    gridFlow2 = phantomcalc[2]
    return gridNoFlow, gridFlow1, gridFlow2

